import React, { Component } from 'react';

export default class BoxCanvas extends Component{
    n = 4;
    m = 5;
    render(){

        const circle = <div>o</div>
        const line = <div>-</div>
        const rect = <div> H </div>
        const item = <div>{circle}{line}{rect}</div>
        var body = () => {for(let i = 0; i < this.m; i++){
            for(let j = 0; j < this.n; j++){
                return {item}
            }
        }}
        return(
            <div>
                dots boxess
                {body} 


            </div>
        )
    }
}
